var boardPrefab = new Prefab("Board");
boardPrefab.getComponent("transform").pos.z = -1;
boardPrefab.addComponent((new ComponentImageRenderer()).fromJSON({
    url     : "http://www.chesshouse.com/v/vspfiles/photos/CHW31-2.jpg",
    width   : 600,
    height  : 600
}));

var pieceImage = {
    "Bishop B" : "data:image/png;base64,",
    "Bishop W" : "data:image/png;base64,",
    "King B" : "data:image/png;base64,",
    "King W" : "data:image/png;base64,",
    "Knight B" : "data:image/png;base64,",
    "Knight W" : "data:image/png;base64,",
    "Pawn B" : "data:image/png;base64,",
    "Pawn W" : "data:image/png;base64,",
    "Queen B" : "data:image/png;base64,",
    "Queen W" : "data:image/png;base64,",
    "Rook B" : "data:image/png;base64,",
    "Rook W" : "data:image/png;base64,"
}
socket.emit('createPrefab',boardPrefab);

for(var name in pieceImage) {
    var prefab = new Prefab(name);
    prefab.addComponent((new ComponentCursorCollider()).fromJSON({
        width  : 30,
        height : 50
    }));
    prefab.addComponent((new ComponentImageRenderer()).fromJSON({
        url     : pieceImage[name],
        width   : 30,
        height  : 50
    }));
    console.log(prefab);
    socket.emit('createPrefab',prefab);
}